import image4 from 'Elements/family.jpg'
export const Header = () => {
    return (
      <div className="relative  w-screen  px-4 py-16 mx-auto  ">
        <div className=" border-red-400 z-0 h-full">
          <img
            src={image4}
            className="bject-cover w-full h-full"
            alt=""
          />
        </div>
        <div className="relative flex max-w-xl mx-auto lg:max-w-screen-xl">
          <div className="mb-16 lg:max-w-lg lg:mb-0">
            <div className="max-w-xl mb-6">
              
              <h2 className="max-w-lg mb-6 font-sans text-7xl font-bold tracking-tight text-gray-900 sm:text-4xl sm:leading-none">
                The Pod
                <br className="hidden md:block" />
                POD{' '}
                <span className="inline-block text-deep-purple-accent-400">
                  Clinic
                </span>
              </h2>
              <p className="text-base text-gray-700 md:text-lg">

                {/* Greater Manchester Based Podariatry Clinic Service */}
              </p>
            </div>
          </div>
        </div>
      </div>
    );
  };
  export default Header;
